import { useEffect, useState } from 'react'
import './app.css'



function App() {


  // useeffect simply ek function ahe je thodi hi mahiti jari update zali website madhe kinva render zali tr han function call hoto apoaap
  // it takes a function as a parameter always 
  useEffect( ()=> alert("button is clicked !!") )

  const [no , setNo] = new useState(0);
  return (
    <div className="App ">
      <button onClick={ 
        ()=>{ setNo(no+1) }}
      > click - {no}</button>
    </div>
  );
}

export default App;
